import React,{Suspense} from 'react';
import {Switch,Route} from 'react-router-dom';
import './App.css';
import routes from './pages/routes';

function App() {
  return (
    <Switch>
      {routes.map(({component:Component,path,...rest})=>{
        return <Route render={(props)=>{
          <Suspense fallback={"loading..."}>
            <Component {...props} />
          </Suspense>
        }} />
      })}
    </Switch>
  );
}

export default App;
